import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = ({ isLoggedIn }) => {
  return (
    <nav className="navbar">
      <Link to="/" className="button-64">
        <span className="text">Home</span>
      </Link>
      {isLoggedIn && (
        <>
          <Link to="/events" className="button-64">
            <span className="text">Events</span>
          </Link>
          <Link to="/guests" className="button-64">
            <span className="text">Guests</span>
          </Link>
          <Link to="/add-event" className="button-64">
            <span className="text">Add Event</span>
          </Link>
          <Link to="/add-guest" className="button-64">
  <span className="text">Add Guest</span>
</Link>
        </>
      )}
      {!isLoggedIn && (
        <Link to="/sign-in" className="button-64">
          <span className="text">Sign In</span>
        </Link>
      )}
    </nav>
  );
};

export default NavBar;
